import React from "react";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";


export default function SignUpPart2() {
    return (
        <div class="login-header">
            <h2>Complete Profile Info</h2>
            <form method="post">
                <input id="login-box" type="Email" placeholder="email" required>
                </input>
                <br />
                <input id="login-box" type="Phone" placeholder="new password" required>
                </input>
                <br />
                <button type="submit">Finish Sign Up</button>
            </form>
        </div>
    );
}
